      'old', row_to_json((SELECT  "e"  FROM  (SELECT  OLD."stock_id" , OLD."good_received_id" , OLD."qty" , OLD."created_at" , OLD."id" , OLD."updated_at" , OLD."unit_price"        ) AS "e"      ) ),
      'new', NULL
