--
-- Name: stock_reduce(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.stock_reduce(transition_id text) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
   transactions_items RECORD;
   each_item RECORD;
   recipe_item RECORD;
   stock_item RECORD;
   stock_item_detail RECORD;
   unit_measure RECORD;
   
   reduce_stock numeric;
   mergin_stock numeric;
   current_stock numeric;
   
   
   purchase_reduce_stock numeric;
   purchase_mergin_stock numeric;
   purchase_current_stock numeric;
   
BEGIN
    -- Fetch the transaction record into a variable
    SELECT * INTO transactions_items FROM transactions WHERE transactions.id = transition_id::uuid;
    
    -- Check if the transaction was found
    IF FOUND THEN 
        -- Loop through the transaction items related to the transaction
        FOR each_item IN 
            SELECT * FROM transaction_items WHERE transaction_items.transaction_id = transition_id ::uuid
        LOOP
            -- Perform some logic with each_item (e.g., reducing stock)
            RAISE NOTICE 'Each item: %', each_item;
            
            IF each_item.normal_menu_item_id is not null then
            
             SELECT * INTO recipe_item FROM menu_recipe_items WHERE menu_recipe_items.menu_id = each_item.normal_menu_item_id;
             
             RAISE NOTICE 'RECIPE_ITEM %',recipe_item;
             
             SELECT *  INTO stock_item FROM recipe_items WHERE recipe_items.recipe_id = recipe_item.recipe_id;
             
             RAISE NOTICE 'STOCK_ITEM %',stock_item;
             
             IF FOUND THEN
              
              SELECT *  INTO stock_item_detail FROM stock_items WHERE stock_items.id = stock_item.stock_items_id;
              
              RAISE NOTICE 'STOCK QTY %',stock_item_detail.recipe_qty;
              RAISE NOTICE 'RECIPE QTY %',stock_item.qty;
              
              SELECT *  INTO unit_measure FROM unit_of_measurement WHERE  unit_of_measurement.id = stock_item_detail.unit_id;
              
              RAISE NOTICE 'UNIT MEASURE %',unit_measure;
              
              IF unit_measure.recipe_qty is not null then
               
                -- inventory reduce 
                reduce_stock   := stock_item_detail.inventory_qty - 1;
                 
                mergin_stock :=  unit_measure.recipe_qty * reduce_stock;
                 
                 current_stock := stock_item_detail.recipe_qty - stock_item.qty * each_item.quantity;
                 
                  
                  
                
                  -- reduce qty 
                   UPDATE stock_items
                     SET recipe_qty = current_stock
                    
                     WHERE id = stock_item.stock_items_id;
                   
                   
                   IF current_stock < mergin_stock then
                    
                    reduce_stock =   current_stock / unit_measure.recipe_qty;
                     
                    UPDATE stock_items
                     SET inventory_qty = reduce_stock
                    
                     WHERE id = stock_item.stock_items_id;
                   
                   END IF;
                   
                    -- purchase reduce;
                 
                 purchase_reduce_stock := stock_item_detail.purchase_qty -1;
                 
                 purchase_mergin_stock := unit_measure.inventory_qty * purchase_reduce_stock;
                 
                 purchase_current_stock := stock_item_detail.inventory_qty / unit_measure.inventory_qty;
                 
                   IF purchase_current_stock < purchase_mergin_stock then
                  
                   UPDATE stock_items
                     SET purchase_qty = purchase_current_stock
                    
                     WHERE id = stock_item.stock_items_id;
                     
                    END IF;
                   
                  
              ELSE 
              
                
                  UPDATE stock_items
                     SET inventory_qty = stock_item_detail.inventory_qty - stock_item.qty 
                    
                     WHERE id = stock_item.stock_items_id;
                     
                -- purchase reduce;
                 
                 purchase_reduce_stock := stock_item_detail.purchase_qty -1;
                 
                 purchase_mergin_stock := unit_measure.inventory_qty * purchase_reduce_stock;
                 
                 purchase_current_stock := stock_item_detail.inventory_qty / unit_measure.inventory_qty;
                 
                   IF purchase_current_stock < purchase_mergin_stock then
                  
                   UPDATE stock_items
                     SET purchase_qty = purchase_current_stock
                    
                     WHERE id = stock_item.stock_items_id;
                     
                    END IF;
              
              END IF;
               
             END IF;
            ELSE 
             
             
             FOR recipe_item IN
                SELECT * FROM combo_menu_items WHERE combo_menu_items.combo_set_id = each_item.combo_set_id
            LOOP
            
             RAISE NOTICE 'RECIPE_ITEM %', recipe_item; 
             
            END LOOP;
            
             
             END IF;
            
        END LOOP;
    ELSE
        -- Handle case where transaction is not found
        RAISE NOTICE 'Transaction not found with ID: %', transition_id;
    END IF;
    
    -- Return a placeholder result for now
    RETURN 'Stock reduction process completed';
    
END;
$$;


ALTER FUNCTION public.stock_reduce(transition_id text) OWNER TO postgres;

